for each row 
begin
insert into ModbusExchangeLog select
ModbusExchange.* from 
ModbusExchange join Devices where Devices.DeviceKey=ModbusExchange.DeviceKey and
ModbusExchange.ExchangeKey=NEW.ExchangeKey and Devices.ModbusExchangeLog='True';
DELETE FROM ModbusExchangeLog WHERE adddate(Timestamped, (SELECT DaysKeepLog FROM Devices WHERE DeviceKey=NEW.DeviceKey)) < now();
end */;;
